import {Router} from 'express'
import * as userCntrl from '../controllers/user.controller'
import {authJwt, verifySignup} from '../middlewares'

const router = Router()

router.post('/', [
    authJwt.verifyToken,
    authJwt.isAdmin,
    verifySignup.checkRolesExisted
], userCntrl.createUser)


export default router;

